        </p>
        <p>
            A hangsúly pedig nem a lexikális részén van, hanem a nyelvektől független (nyelvagnosztikus) algoritmikus gondolkodáson, amelyet minden programozó elsajátít az évek alatt mire rájön, hogy legalapvetőbb építőelemeiket tekintve majdnem az összes nyelv u");
            WriteLiteral(@"gyanolyan, méghozzá több mint 20 éve.
        </p>
        <p>
            Azóta több paradigma is született, de a legfontosabb, hogy a megoldásunk fő logikáját még mindig a strukturált programozási paradigma elemeivel oldjuk meg. Az ő utána következők - ahogy ősei is - nem alternatív megközelítések, hanem az előzőnek a kibővítése, hogy a projektjeinket még rendszerezettebbé, protokollosabbá, újrafelhasználhatóbbá és absztraktabbá tegyük, amely a nagyvállalati méretű projektet hosszú távú könnyű bővíthetőségén segít.
        </p>
        <p>
            A nyelvek egymástól bizonyos részletekben térnek csak el, amely miatt esetleg van amelyik adekváltabb egy olyan feladatra amelyre a másik kevésbé, esetleg az egyik az egyszerűségre törekszik, a másik alacsonyabb szintű és több kontrollt ad a kezünkbe, a másik átmenet a kettő között, szintaktikailag is kicsit mások, illetve a paradigmákról is esetleg apróságokban más lehet a véleményük, de alapvetően megegyeznek legfontosabb elemeikben.
